// react
import React, { Component, Fragment } from "react";

// third part
import { Route, Switch } from "react-router-dom";

import SignIn from "./components/SignInForm";

export default class App extends Component {
  render() {
    return (
      <Fragment>
        <Switch>
          <Route path="/" component={SignIn} />
        </Switch>
      </Fragment>
    );
  }
}
